import Link from "next/Link";
import { withRouter } from "next/router";
import NavBar from "../components/NavBar";

function Index() {
  console.log("*****************Index Component*******************");
  return (
    <div>
      <NavBar />
      <h1>hello world</h1>
    </div>
  );
}

export default withRouter(Index);
